import React from "react";
import styled from "styled-components";

const Wrapper = styled.header`
	background-color: #24252a;
	padding: 15px 10px;
	display: flex;
	align-items: center;

	justify-content: end;
`;

const Logo = styled.img`
	margin-right: auto;
`;

const A = styled.a``;

const NavBar = styled.nav``;

const Ul = styled.ul``;

const Li = styled.li``;

const Button = styled.button`
	padding: 9px 25px;
	margin: 0 15px;
	background-color: black;
	color: white;
	border-radius: 50px;
	border: none;
	cursor: pointer;
`;

const Header = () => {
	return (
		<Wrapper>
			<A href="/">
				<Logo src="/logo.png" alt="logo" />
			</A>
			<NavBar>
				<Ul>
					<Li>
						<A href="/">
							<Button>About</Button>
						</A>
						<A href="/">
							<Button>Projects</Button>
						</A>
						<A href="/">
							<Button>Contact</Button>
						</A>
					</Li>
				</Ul>
			</NavBar>
		</Wrapper>
	);
};

export default Header;
